import React from 'react';
import { servicesData } from '../data/portfolioData';

const Services = () => {
  return (
    <section id="services" className="section-padding bg-light">
      <div className="container">
        <h2 className="section-title text-center mb-5">My Services</h2>
        <div className="row g-4">
          {servicesData.map((service, index) => (
            <div
              className="col-lg-6 col-md-6"
              key={index}
              data-aos="fade-up"
              data-aos-delay={index * 100}
            >
              <div className="service-card card h-100 border-0 shadow-sm">
                <div className="card-body text-center p-4">
                  <i className={`${service.icon} fa-3x text-primary mb-3`}></i>
                  <h3 className="card-title h4 mb-3">{service.title}</h3>
                  <p className="card-text text-muted">{service.description}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Services;
